import React from 'react';
import { motion } from 'framer-motion';
import { useNavigate } from 'react-router-dom';
import './LandingPage.css';

// Import background images (you'll need to add these to your project)
// For now using placeholder divs with background colors
// You can replace these with actual images

const LandingPage = () => {
  const navigate = useNavigate();

  const handleStartLearning = () => {
    navigate('/signup');
  };

  const handleGetStarted = () => {
    navigate('/signup');
  };

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: { staggerChildren: 0.2 },
    },
  };

  const itemVariants = {
    hidden: { y: 20, opacity: 0 },
    visible: { y: 0, opacity: 1, transition: { duration: 0.6 } },
  };

  return (
    <div className="landing-page">
      {/* Hero Section */}
      <section className="hero-section">
        <div className="hero-background">
          <div className="data-science-bg-image"></div>
          <div className="gradient-circle blue"></div>
          <div className="gradient-circle teal"></div>
          <div className="gradient-circle purple"></div>

          {/* Moving Data Science Background Elements */}
          <div className="data-science-background">
            <motion.div 
              className="moving-element element-1"
              animate={{ 
                x: [0, 100, 0],
                y: [0, -50, 0],
                rotate: [0, 10, 0]
              }}
              transition={{ 
                duration: 20, 
                repeat: Infinity,
                ease: "easeInOut"
              }}
            >
              <div className="ds-icon">üìä</div>
            </motion.div>

            <motion.div 
              className="moving-element element-2"
              animate={{ 
                x: [0, -80, 0],
                y: [0, 60, 0],
                rotate: [0, -15, 0]
              }}
              transition={{ 
                duration: 18, 
                repeat: Infinity,
                ease: "easeInOut",
                delay: 2
              }}
            >
              <div className="ds-icon">ü§ñ</div>
            </motion.div>

            <motion.div 
              className="moving-element element-3"
              animate={{ 
                x: [0, 120, 0],
                y: [0, 40, 0],
                rotate: [0, 8, 0]
              }}
              transition={{ 
                duration: 22, 
                repeat: Infinity,
                ease: "easeInOut",
                delay: 1
              }}
            >
              <div className="ds-icon">üìà</div>
            </motion.div>

            <motion.div 
              className="moving-element element-4"
              animate={{ 
                x: [0, -60, 0],
                y: [0, -70, 0],
                rotate: [0, -12, 0]
              }}
              transition={{ 
                duration: 16, 
                repeat: Infinity,
                ease: "easeInOut",
                delay: 3
              }}
            >
              <div className="ds-icon">üß†</div>
            </motion.div>

            <motion.div 
              className="moving-element element-5"
              animate={{ 
                x: [0, 70, 0],
                y: [0, -30, 0],
                rotate: [0, 5, 0]
              }}
              transition={{ 
                duration: 19, 
                repeat: Infinity,
                ease: "easeInOut",
                delay: 4
              }}
            >
              <div className="ds-icon">üîç</div>
            </motion.div>

            <motion.div 
              className="moving-element element-6"
              animate={{ 
                x: [0, -100, 0],
                y: [0, 20, 0],
                rotate: [0, -8, 0]
              }}
              transition={{ 
                duration: 21, 
                repeat: Infinity,
                ease: "easeInOut",
                delay: 5
              }}
            >
              <div className="ds-icon">üíª</div>
            </motion.div>

            {/* Data points floating around */}
            {[...Array(12)].map((_, i) => (
              <motion.div
                key={i}
                className={`data-point point-${i + 1}`}
                animate={{
                  y: [0, -20, 0],
                  opacity: [0.3, 0.8, 0.3]
                }}
                transition={{
                  duration: 3 + i * 0.5,
                  repeat: Infinity,
                  delay: i * 0.3
                }}
              />
            ))}
          </div>
        </div>

        <div className="hero-content-container">
          <motion.div 
            className="hero-content" 
            initial="hidden" 
            animate="visible" 
            variants={containerVariants}
